INSERT INTO `forwarder_incoterm` VALUES ('1', 'EXW', 'Ex Works', ' pihak penjual menentukan tempat pengambilan barang.', '2019-08-18 14:12:25', '2019-08-18 14:12:25');
INSERT INTO `forwarder_incoterm` VALUES ('2', 'FCA', ' Free Carrier', 'pihak penjual hanya bertanggung jawab untuk mengurus izin ekspor dan meyerahkan barang ke pihak pengangkut di tempat yang telah ditentukan.', '2019-08-18 14:12:51', '2019-08-18 14:12:51');
INSERT INTO `forwarder_incoterm` VALUES ('3', 'FAS', 'Free Alongside Ship', 'pihak penjual bertanggung jawab sampai barang berada di pelabuhan keberangkatan dan siap disamping kapal untuk dimuat. Hanya berlaku untuk transportasi air.', '2019-08-18 14:13:09', '2019-08-18 14:13:09');
INSERT INTO `forwarder_incoterm` VALUES ('4', 'FOB', ' Free On Board', 'pihak penjual bertanggung jawab dari mengurus izin ekspor sampai memuat barang di kapal yang siap berangkat. Hanya berlaku untuk transportasi air.', '2019-08-18 14:13:36', '2019-08-18 14:13:36');
INSERT INTO `forwarder_incoterm` VALUES ('5', 'CFR', 'Cost and Freight', 'pihak penjual menanggung biaya sampai kapal yang memuat barang merapat di pelabuhan tujuan, tetapi tanggung jawab hanya sampai saat kapal berangkat dari pelabuhan keberangkatan. Hanya berlaku untuk transportasi air.', '2019-08-18 14:14:38', '2019-08-18 14:14:38');
INSERT INTO `forwarder_incoterm` VALUES ('6', 'CIF', ' Cost, Insurance and Freight', 'sama seperti CFR ditambah pihak penjual wajib membayar asuransi untuk barang yang dikirim. Hanya berlaku untuk transportasi air.', '2019-08-18 14:14:55', '2019-08-18 14:14:55');
INSERT INTO `forwarder_incoterm` VALUES ('7', 'CPT', ' Carriage Paid To', 'pihak penjual menanggung biaya sampai barang tiba di tempat tujuan, tetapi tanggung jawab hanya sampai saat barang diserahkan ke pihak pengangkut.', '2019-08-18 14:15:11', '2019-08-18 14:15:11');
INSERT INTO `forwarder_incoterm` VALUES ('8', 'CIP', ' Carriage and Insurance Paid to', 'sama seperti CPT ditambah pihak penjual wajib membayar asuransi untuk barang yang dikirim.', '2019-08-18 14:15:35', '2019-08-18 14:15:35');
INSERT INTO `forwarder_incoterm` VALUES ('9', 'DAF', 'Delivered At Frontier', 'pihak penjual mengurus izin ekspor dan bertanggung jawab sampai barang tiba di perbatasan negara tujuan. Bea cukai dan izin impor menjadi tanggung jawab pihak pembeli.', '2019-08-18 14:15:55', '2019-08-18 14:15:55');
INSERT INTO `forwarder_incoterm` VALUES ('10', 'DES', 'Delivered Ex Ship', 'pihak penjual bertanggung jawab sampai kapal yang membawa barang merapat di pelabuhan tujuan dan siap untuk dibongkar. izin impor menjadi tanggung jawab pihak pembeli. Hanya berlaku untuk transportasi air.', '2019-08-18 14:16:41', '2019-08-18 14:18:25');
INSERT INTO `forwarder_incoterm` VALUES ('11', 'DEQ', ' Delivered Ex Quay', 'pihak penjual bertanggung jawab sampai kapal yang membawa barang merapat di pelabuhan tujuan dan barang telah dibongkar dan disimpan di dermaga. Izin impor menjadi tanggung jawab pihak pembeli. Hanya berlaku untuk transportasi air.', '2019-08-18 14:17:00', '2019-08-18 14:17:00');
INSERT INTO `forwarder_incoterm` VALUES ('12', 'DDU', ' Delivered Duty Unpaid', 'pihak penjual bertanggung jawab mengantar barang sampai di tempat tujuan, tetapi tidak termasuk biaya asuransi dan biaya lain yang mungkin muncul sebagai biaya impor, cukai dan pajak dari negara pihak pembeli. Izin impor menjadi tanggung jawab pihak pembeli.', '2019-08-18 14:17:25', '2019-08-18 14:17:25');
INSERT INTO `forwarder_incoterm` VALUES ('13', 'DDP', ' Delivered Duty Paid', 'pihak penjual bertanggung jawab mengantar barang sampai di tempat tujuan, termasuk biaya asuransi dan semua biaya lain yang mungkin muncul sebagai biaya impor, cukai dan pajak dari negara pihak pembeli. Izin impor juga menjadi tanggung jawab pihak penjual.', '2019-08-18 14:17:44', '2019-08-18 14:17:44');
